import React from "react";

const Header = () => {
  return (
    <>
      <header>
        <h1>Purple Cow Counter</h1>
      </header>
      <div className={classes["main-image"]}>
        <img src={MealImage} alt="some tasty meals!"></img>
      </div>
    </>
  );
};

export default Header;
